import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom'
import { productProvider } from './components/providers/productProvider'

ReactDOM.render(
	<productProvider>
		<Router>
			<App />
		</Router>
	</productProvider>
	, document.getElementById('root'));
